var ConfettiFountainWidget = (function(){
    /* compact way of setting PI = Math.PI & so on... */
    Object.getOwnPropertyNames(Math).map(function(p) {
      window[p] = Math[p]
    });
    /* oh, why? because I',m lazy, that's why! :P */



    /*
     * =============================================
     * FUNCTIONS
     * =============================================
     */

    /* 
     * generates a random number in the [min, max) interval
     * max: upper boundary for generated number; 
     *      defaults to 1
     * min: lower boundary for generated number; 
     *      defaults to 0
     * _int: flag specifying if generated number 
     *       should be rounded to the nearest integer
     *       falsy by default
     */
    var rand = function(max, min, _int) {
      var max = (max === 0 || max)?max:1, 
          min = min || 0, 
          gen = min + (max - min)*random();
      
      return (_int)?round(gen):gen;
    };


    function getImages(imageSetting, isOriginal){
      var images = [];

      if(imageSetting && imageSetting.length > 0)
          for(var i=0;i<imageSetting.length;i++){
              var imgArr = imageSetting[i].images
              if(isOriginal)
                  images.push(imgArr[0].url); // get original image
              else
                  images.push(imgArr[imgArr.length-1].url); //get smallest image
          }

      return images;
    }


    /*
     * =============================================
     * GLOBALS
     * =============================================
     */
    var c = document.getElementById('confettiFountainCanvas') /* canvas elem */, 
        w /* canvas width */, h /* canvas height */, 
        ctx = c.getContext('2d') /* get canvas context */,
        confettis = [],
        particles = [], 
        source = {} /* particle fountain source */, 
        t = 0, 
        req_id = null;


    // default settings
    var N_PARTICLES = 256;
    var numberTypeParticles = 9;
    var followCursor = true;
    var customImages = new Array();
    var isRegisterEvent = false;
    var onlyCustomImage = false;
    var maxImageSize = 25;
    var gravity = 3;
    var extraInitSpeed = 0;

    /*
     * =============================================
     * OBJECTS USED
     * =============================================
     */
    var Particle = function(i) {
      var confetti /* current confetti piece */, 
          pos /* current particle position */, 
          v /* current particle velocity */, 
          a /* current particle acceleration */, 
          c_angle /* confetti particle angle */,
          angle_v /* angle velocity */,
          /* delay when shooting up 
           * so that they don't go all up at the same time
           * randomly generated
           */
          delay = rand(N_PARTICLES, 0, 1);
      
      /* active = was already shot up, but hasn't landed yet */
      this.active = false;
      
      /*
       * make particle active and give it a velocity so that 
       * it can start moving
       */
      this.shoot = function(ctx) {
        var angle, angle_var, val, 
            hue = rand(360, 0, 1);
        
        /* check if time for shooting this particle has arrived */
        if(t - delay >= 0) {
          /* make it active */
          this.active = true;
          
          /* choose our confetti */
          confetti = confettis[floor(random() * (confettis.length < numberTypeParticles ? confettis.length : numberTypeParticles))];

          /* position it at the fountain source, 
           * but a bit lower, depending on its radius
           */
          pos = { 'x': source.x + rand(-10, 10), 'y': source.y };
          
          /*
           * give it an acceleration considering gravity
           * and uniform friction (depending on its radius)
           */
          a = { 'x': 0, 'y': gravity/10};
          
          /* generate a random angle at which it shoots up */
          angle = rand(PI/8, -PI/8) - PI/2;
          
          /* Set up our confetti particle angle */
          c_angle = 0;
          angle_v = rand(-30, 30);
          
          /* generate random velocity absolute value in that direction */
          val = rand(h/10, h/4)*a.y;
          if(val > h/25){
            val = rand(h/40, h/20);
          }
          val *= 1 + extraInitSpeed/10;
          
          /* compute initial velocity components */
          v = {
            'x': val*cos(angle), 
            'y': val*sin(angle)
          };
        }
      };
      
      /*
       * particle is in motion, update its velocity and position
       */
      this.motionUpdate = function() {
        /*
         * velocity_incr = acceleration * time_incr
         * position_incr = velocity * time_incr
         * but time_incr = 1 in our case
         * (see the t++ line in drawOnCanvas)
         * so compute new velocity and position components
         * based on this
         */


        v.x += a.x;
        v.y += a.y;
        pos.x += round(v.x);
        pos.y += round(v.y);
        c_angle += angle_v;


        /* if it has landed = it's below canvas bottom edge */
        if(pos.y > h | pos.x < 0 | pos.x > w) {
          /* reset position to the initial one */
          pos = { 'x': source.x, 'y': source.y };
          /* ... and make this particle inactive */
          this.active = false;
        }
      };
      
      this.draw = function(ctx) {
        ctx.save(); 
        ctx.translate(pos.x, pos.y);
        ctx.rotate(c_angle * Math.PI / 180);

        ctx.drawImage(confetti, -(confetti.width/2), -(confetti.height/2), confetti.width, confetti.height);

        ctx.restore(); 
        
        /* update its velocity and position */
        this.motionUpdate();
      };
    }



    /* Load up some confetti! */
    var loadConfetti = function(callback) {
      confettis = new Array();

      var loadCustomImage = function(callback){

        var loadImage = function(index){
          var image = new Image();

          // the image is loaded successfully
          image.onload = function(){

            if(this.width > maxImageSize || this.height > maxImageSize) {
              if(this.width > this.height) {
                var temp = this.height/this.width;
                this.width = maxImageSize;
                this.height = temp * maxImageSize;
              }
              else {
                var temp = this.width/this.height;
                this.height = maxImageSize;
                this.width = temp * maxImageSize;
              }
            }

            confettis.push(this);
            if(index >= customImages.length - 1) {
              callback();
            }
            else {
              loadImage(index + 1);
            }
          };

          // fail to load the image, load the next one
          image.onerror = function(){
            if(index >= customImages.length - 1) {
              callback();
            }
            else {
              loadImage(index + 1);
            }
          }

          image.src = customImages[index];

        };

        loadImage(0);
      };

      var loadDefaultImage = function() {
        var confetti_orange = new Image;
        confetti_orange.src = "data:image/png;base64,";
        confettis.push(confetti_orange);

        var confetti_blue = new Image;
        confetti_blue.src = "data:image/png;base64,";
        confettis.push(confetti_blue);

        var confetti_purple = new Image;
        confetti_purple.src = "data:image/png;base64,";
        confettis.push(confetti_purple);

        var confetti_green = new Image;
        confetti_green.src = "data:image/png;base64,";
        confettis.push(confetti_green);

        var confetti_yellow = new Image;
        confetti_yellow.src = "data:image/png;base64,";
        confettis.push(confetti_yellow);

        var confetti_purple_circle = new Image;
        confetti_purple_circle.src = "data:image/png;base64,";
        confettis.push(confetti_purple_circle);

        var confetti_orange_circle = new Image;
        confetti_orange_circle.src = "data:image/png;base64,";
        confettis.push(confetti_orange_circle);
        
        var confetti_blue_bar = new Image;
        confetti_blue_bar.src = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAGCAYAAADKfB7nAAAANklEQVQYGWNkWHcolYGRUYqBHPDv/ywWoOZ0oF5jcvQzMDFuYSJLI5KmgTeAheH//5kUBOIzAHcGC4ESYxi3AAAAAElFTkSuQmCC"
        confettis.push(confetti_blue_bar);
        
        var confetti_star = new Image;
        confetti_star.src = "data:image/png;base64,"
        confettis.push(confetti_star);
      }

      if(customImages.length > 0) {
        loadCustomImage(function(){
          if(!onlyCustomImage) {
            loadDefaultImage();
          }
          callback();
        });
      }
      else {
        loadDefaultImage();
        callback();
      }
    };



    /*
     * initializes a bunch of basic stuff
     * like canvas dimensions, 
     * default particle source, 
     * particle array...
     */
    var initCanvas = function() {
      var s = getComputedStyle(c);
      
      /* stop animation if any got started */
      if(req_id) {
        particles = [];
        cancelAnimationFrame(req_id);
        req_id = null;
        t = 0;
      }
      
      /* 
       * set canvas width & height
       * don't forget to also set the width & height attributes
       * of the canvas element, not just the w & h variables
       */
      w = c.width = ~~s.width.split('px')[0];
      h = c.height = ~~s.height.split('px')[0];
      
      /* set an inital source for particle fountain */
      source = { 'x': round(w/2), y: h };
      
      /* create particles and add them to the particle array */
      for(var i = 0; i < N_PARTICLES; i++) {
        particles.push(new Particle(i));
      }
      
      if(w == 0 || h == 0)
        return;
      
      drawOnCanvas();
    };


    /*
     * goes through the particle array and
     * may call a particle's draw function
     */
    var drawOnCanvas = function() {
        ctx.clearRect ( 0 , 0 , w, h );

      
      /* go through each particle in the particle array */
      for(var i = 0; i < N_PARTICLES; i++) {
        if(particles[i].active) {// if it's active
          particles[i].draw(ctx); // draw it on canvas
        }
        else { // if not...
          particles[i].shoot(ctx); // try to make it shoot up
        }
      }
      
      t++; /* time increment */
      
      /**/
      req_id = requestAnimationFrame(drawOnCanvas);
      /**/
    };
    

    /*---------------------------------------------------------*/

    function loadSettings() {
    
      customImages.push("data:image/png;base64,");

      customImages.push("data:image/png;base64,");

      customImages.push("data:image/png;base64,");

      customImages.push("data:image/png;base64,");
    


      if(typeof BannerFlow !== "undefined") {
        N_PARTICLES = BannerFlow.settings.numberParticles > 0 ? BannerFlow.settings.numberParticles : 256;
        numberTypeParticles = BannerFlow.settings.numberTypeParticles > 0 ? BannerFlow.settings.numberTypeParticles : 9;
        followCursor = BannerFlow.settings.followCursor;
        onlyCustomImage = BannerFlow.settings.onlyCustomImage;
        maxImageSize = BannerFlow.settings.maxImageSize;
        gravity = BannerFlow.settings.gravity > 0 ? BannerFlow.settings.gravity : 4;
        extraInitSpeed = BannerFlow.settings.extraInitSpeed;

        customImages = getImages(BannerFlow.settings.image, true);

        // var imageOne = BannerFlow.settings.imageOne;
        // var imageTwo = BannerFlow.settings.imageTwo;
        // var imageThree = BannerFlow.settings.imageThree;
        // var imageFour = BannerFlow.settings.imageFour;

        // customImages = new Array();
        // if(imageOne && imageOne.length > 0) {
        //   customImages.push(imageOne);
        // }

        // if(imageTwo && imageTwo.length > 0) {
        //   customImages.push(imageTwo);
        // }

        // if(imageThree && imageThree.length > 0) {
        //   customImages.push(imageThree);
        // }

        // if(imageFour && imageFour.length > 0) {
        //   customImages.push(imageFour);
        // }
      }
    }


    function startAnimation() {
      setTimeout(function() {
        initCanvas();
        
        /* set new canvas dimensions on viewport resize */
        
        if(followCursor && !isRegisterEvent) {

          isRegisterEvent = true;

          if(typeof BannerFlow !== "undefined") {
            BannerFlow.addEventListener(BannerFlow.MOUSE_MOVE, function () { 
                ctx.clearRect(0, 0, w, h);
              
                /* move x coordinate of particle fountain source */
                source.x = BannerFlow.mouseX - BannerFlow.x;
                source.y = BannerFlow.mouseY - BannerFlow.y;
            });
          }
        }
      }, 15);
    }
    

    function init() {
      loadSettings();
      loadConfetti(startAnimation);
    }


    var isStartAnimation = false;
    function onStart() {
      if(typeof BannerFlow != "undefined" && !BannerFlow.editorMode && isStartAnimation) {
          return;
      }

      isStartAnimation = true;

      init();
    }

    function onResized(){
      if(typeof BannerFlow != "undefined" && !BannerFlow.editorMode) {
          return;
      }

      init();
    }

    function onSettingChanged(){
      if(typeof BannerFlow != "undefined" && !BannerFlow.editorMode) {
          return;
      }

      init();
    }


    return {
        start: onStart,

        onResized: onResized,

        onSettingChanged: onSettingChanged
    };
})();

if(typeof BannerFlow == "undefined"){
  ConfettiFountainWidget.start();
} else {
  BannerFlow.addEventListener(BannerFlow.START_ANIMATION, function () {
      ConfettiFountainWidget.start();
  });

  BannerFlow.addEventListener(BannerFlow.RESIZE, function () {
      ConfettiFountainWidget.onResized();
  });

  BannerFlow.addEventListener(BannerFlow.SETTINGS_CHANGED, function () {
      ConfettiFountainWidget.onSettingChanged();
  });
}
